import React, { Component } from 'react'
import './AboutMe.css'


export default class AboutMe extends Component {
  render() {
    return (
      <div className="container">
        <div className="about">
          <img className="avatar" src="./images/Avatar.png" alt="Avatar"/>

          <div className="desc">
            <h1>About Me</h1>
          </div>
        </div>
      </div>
    )
  }
}
